oxy_webhelp_navlinks = {"annapurna-d22908e39405":{"topics":[{"title":"Annapurna framework","shortdesc":"<p class=\"shortdesc\">Annapurna uses an embedding model to change source data and chatbot questions into         vector embeddings. These embeddings are stored in a vector database. The vector embeddings         from the data source that match the query vector embeddings are then combined to create the         prompt sent to the LLM.<\/p>","href":"ai\/annapurna_framework.html","attributes":{"data-id":"annapurna_framework"},"menu":{"hasChildren":false},"tocID":"annapurna_framework-d22908e39418","topics":[]},{"title":"Benefits of Annapurna","shortdesc":"<p class=\"shortdesc\">Annapurna enables enterprises to securely leverage retrieval-augmented generation and         generative AI for enhanced data understanding, solving complex business use cases by         correlating data from multiple sources without disrupting backup and recovery         operations.<\/p>","href":"ai\/annapurna_benefits.html","attributes":{"data-id":"annapurna_benefits"},"menu":{"hasChildren":false},"tocID":"annapurna_benefits-d22908e39429","topics":[]},{"title":"Creating a chatbot","shortdesc":"<p class=\"shortdesc\">Create an Annapurna chatbot that uses retrieval-augmented generation to answer your         data-related questions.<\/p>","href":"ai\/creating_annapurna_chatbot.html","attributes":{"data-id":"creating_annapurna_chatbot"},"menu":{"hasChildren":false},"tocID":"creating_annapurna_chatbot-d22908e39440","next":"creating_annapurna_chatbot-d22908e39440"},{"title":"Using a chatbot","shortdesc":"<p class=\"shortdesc\">Use an Annapurna chatbot to start a natural language conversation about your         data.<\/p>","href":"ai\/using_annapurna_chatbot.html","attributes":{"data-id":"using_annapurna_chatbot"},"menu":{"hasChildren":false},"tocID":"using_annapurna_chatbot-d22908e39473","next":"using_annapurna_chatbot-d22908e39473"}]}};